(1, 'backend/logo/1670488465____20885.png', '2019', 'https://tmscedu.com/', '2668e548a3250c3e4126e2e2c830d2797084f918', 'টেপ্রীগঞ্জ মডেল স্কুল এন্ড কলেজ', 'দেবীগঞ্জ, পঞ্চগড়', '২০১৯ খ্রি.', '১২৫৯৮৩', 'backend/HISTORY_OF_THE_ORGANIZATION_IMAGE/1670488466____90080.png', '২০১৯ সালে পঞ্চগড় জেলার দেবীগঞ্জ উপজেলার  সকল শ্রেণি পেশার মানুষের নিকট একটি বিশেষায়িত শিক্ষা প্রতিষ্ঠান উপহার দেয়ার অঙ্গীকার দিয়ে টেপ্রীগঞ্জ মডেল স্কুল এন্ড কলেজের কার্যক্রম শুরু করে।  ছাত্র-ছাত্রীদেরকে পাঠ্যসূচির পাশাপাশি নৈতিক শিক্ষা ও আধুনিক জ্ঞান-বিজ্ঞানের শিক্ষায় শিক্ষিত করে জাতির জন্য একজন আদর্শ ও যোগ্য নাগরিক তৈরির উপযোগী পাঠ্যসূচী প্রণয়ন করে শিক্ষা দেয়ার ব্যবস্থা করেছে  টেপ্রীগঞ্জ মডেল স্কুল এন্ড কলেজ।\r\nআমাদের প্রিয় জন্মভূমি পঞ্চগড় জেলার দেবীগঞ্জ উপজেলার অভিভাবকদের আকাঙ্খিত শিক্ষা প্রতিষ্ঠানের যথেষ্ট অভাব রয়েছে। এ উপলব্ধি করে কয়েকজন তরুণ দেবীগঞ্জ উপজেলার টেপ্রীগঞ্জ  ইউনিয়নে বর্তমান সময়োপযোগী শিক্ষা প্রতিষ্ঠান গড়ার চিন্তা করে। যার ফসল আজকের  টেপ্রীগঞ্জ মডেল স্কুল এন্ড কলেজ।', 'মোঃ মঞ্জুরুল ইসলাম', 'backend/PRINCIPALS_IMGAGE/1670488466____73002.jpeg', 'backend/PRINCIPALS_Signature/1685595164____26025.png', 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Iste quae nisi ratione autem nemo nam architecto. Provident quae delectus nobis et obcaecati nemo vitae. Fugit sequi vero id magnam repellat!Lorem ipsum dolor sit amet consectetur adipisicing elit. Iste quae nisi ratione autem nemo nam architecto.', 'Vice Principals', 'backend/VICE_PRINCIPALS_IMGAGE/1670488466____42690.png', 'backend/VICE_PRINCIPALS_Signature/1670488466____13722.png', 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Iste quae nisi ratione autem nemo nam architecto. Provident quae delectus nobis et obcaecati nemo vitae. Fugit sequi vero id magnam repellat!Lorem ipsum dolor sit amet consectetur adipisicing elit. Iste quae nisi ratione autem nemo nam architecto.', 'https://web.facebook.com/tmscedu', '01737749408', 'Md Nishad Hossain,Md Nishad,Md,Nishad,Hossain,Md Monjurul Islam,Md Monjurul,Islam,Monjurul Islam,